import React, {Component} from 'react';
import {BrowserRouter, Route, Switch, HashRouter} from 'react-router-dom';
import logo from './logo.svg';
import {ChooseDirection} from './Direction';
import {ChooseRoute} from './Route';
import {ShowStops} from './Stops';
import './Mobile.css';
import './Tablet.css';
import './Desktop.css';
import './Luxury.css';
import './App.css';

class Master extends Component {
    constructor(props) {
        super(props);
        this.state = {
            routeData: [],
            route: '',
            routeLoaded: false,
            routeLoading: false,
            directionData: [],
            direction: '',
            directionLoaded: false,
            directionLoading: false,
            stopData: [],
            stopLoaded: false,
            stopLoading: false,
            error: null
        }
        this.getStops = this
            .getStops
            .bind(this);
        this.changeDirection = this
            .changeDirection
            .bind(this);
        this.handleDirection = this
            .handleDirection
            .bind(this);
    }

    componentDidMount = () => {
        this.setState({routeLoading: true})

        fetch('https://svc.metrotransit.org/NexTrip/Routes?format=json')
            .then(res => res.json())
            .then((result) => {
                this.setState({routeLoading: false, routeLoaded: true, routeData: result})
                console.log("Route is loaded, here is data: ")
                console.log(this.state.routeData)
            }, (error) => {
                this.setState({routeLoaded: false, routeLoading: false, error});
            })
    }

    getStops = () => {
        console.log("In getStops");
        this.setState({stopLoading: true})

        console.log("Fetching this route: ")
        console.log('https://svc.metrotransit.org/NexTrip/Stops/' + this.state.route + '/' + this.state.direction + '?format=json')

        fetch('https://svc.metrotransit.org/NexTrip/Stops/' + this.state.route + '/' + this.state.direction + '?format=json')
            .then(res => res.json())
            .then((result) => {
                this.setState({stopData: result, stopLoaded: true})
            }, (error) => {
                this.setState({stopLoaded: false, stopLoading: false, error});
            })
    }

    changeDirection = (event) => {
        console.log("in change direction")
        this.setState({
            direction: event.target.value
        }, this.getStops);
    }

    handleDirection = (event) => {
        console.log("In handleDirection")
        // Update state values
        this.setState({route: event.target.value, directionLoading: true, directionLoaded: false})

        console.log("Updated state.route to")
        console.log(event.target.value)
        console.log('In handle direction');

        fetch('https://svc.metrotransit.org/NexTrip/Directions/' + event.target.value + '?format=json')
            .then(res => res.json())
            .then((result) => {
                this.setState({directionLoaded: true, directionLoading: false, directionData: result, direction: result[0].Value})
                this.getStops();
            }, (error) => {
                this.setState({directionLoaded: false, directionLoading: false, error});
            })
    }

    render() {
        return (
            <HashRouter>
            <Route
                            exact path="/stops"
                            render={() => <div>We are Rendering This</div>}/>
                <React.Fragment>
                    <div className='route-container'>
                        <ChooseRoute
                            state={this.state}
                            routeLoaded={this.state.routeLoaded}
                            routeData={this.state.routeData}
                            routeHandler={this.handleDirection}/>

                        <div className="directions-container" data-testid="Direction-Container">
                            <ChooseDirection
                                directionLoaded={this.state.directionLoaded}
                                directionData0={this.state.directionData[0]}
                                directionData1={this.state.directionData[1]}
                                directionHandler={this.changeDirection}/>
                        </div>

                    </div>
                    <div className="stops-container" data-testid="Stops-Container">
                        <h2>Stops</h2>
                        <ShowStops stopLoaded={this.state.stopLoaded} stopData={this.state.stopData}/>
                        <Route
                            path="/stops"
                            render={() => <ShowStops stopLoaded={this.state.stopLoaded} stopData={this.state.stopData}/>}/>
                    </div>
                </React.Fragment>
            </HashRouter>
        )
    }
}

function App() {
    return (
        <div className='content'>
            <div className='note'>
                <h4>This application is sourced by real-time data from
                </h4>
                <img src='https://www.metrotransit.org/img/MetroTransitLogo.svg'></img>
            </div>
            <h1>NexTrip</h1>
            <BrowserRouter>
                <div className='application'>
                    <Master/>
                </div>
            </BrowserRouter>
        </div>
    );
}

export default App;
